import React, { Component } from 'react';
import NavigationBar from './components/home/navigationBar'; 
import './App.css';
import './assets/css/home/navigationBar.css';
import HomeLeftPanel from './components/home/homeLeftPanel';
import HomeRightPanel from './components/home/homeRightPanel';
import HomeCenterPanel from './components/home/homeCenterPanel';
import MatchHeader from './components/home/matchHeader';

class App extends Component {
  render() {
    return (
      <div className="App">

         <div className="container">

          <div className="row">
            <div className="col-12 pl-2 pr-2">
              {<NavigationBar />}
            </div>
          </div>

          <div className="row">
            <div className="col-12 pl-2 pr-2 mb-1">
                <MatchHeader/>
            </div>
          </div>

          <div className="row">
            <div className="col-lg-2 col-md-2 col-sm-3 col-xs-12 pl-2 pr-0">
                <HomeLeftPanel />
            </div>

            <div className="col-lg-8 col-md-8 col-sm-6 col-xs-12 pl-1 pr-1">
               <HomeCenterPanel />
            </div>

            <div className="col-lg-2 col-md-2 col-sm-3 col-xs-12 pl-0 pr-2">
                 <HomeRightPanel/>
            </div>

          </div>
        </div>
      </div>

    );
  }
}

export default App;
